import React from 'react';
import './App.css';
import Post from './Post';

function App({ username, caption, imageUrl }) {
  return (
    <div className="app">

      <div className="app__header">
          <img
          className='app__headerImage'
          src="https://upload.wikimedia.org/wikipedia/commons/thumb/2/2a/Instagram_logo.svg/320px-Instagram_logo.svg.png"
          alt="logo"
          />
      </div>

      <h1>{username}</h1>
      <Post username="edyttabartosiewicz" caption="Happy days" imageUrl="https://scontent-waw1-1.xx.fbcdn.net/v/t1.6435-9/187384210_3061908687361916_2203947915172169054_n.jpg?_nc_cat=103&ccb=1-7&_nc_sid=09cbfe&_nc_ohc=lq7_y6eSujwAX8K_fqI&_nc_ht=scontent-waw1-1.xx&oh=00_AT9gEg1JB7WbnqXVtnPWxD_1Q3UIcvlo9JfCDoHvFnkN1Q&oe=62D1A368"/>
      <Post/>
      <Post/>
    </div>
  );
}

export default App;
